       <div className="faqouter">
       <FaqItems/>
       <FaqItems/>
       </div>
    </div>
  )
}

export default Faqs;

function FaqItems() {
    return (
        <div className="faqItems">
                <h2>Hello</h2>
                <p>
                 Ws
                </p>
              </div>
    )
}
